import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import About from "./presentation/pages/about";
import Home from "./presentation/pages";
import Blog from "./presentation/pages/blog";
import Contact from "./presentation/pages/contact";
import Services from "./presentation/pages/services";

import Footer from "./presentation/layout/footer";
import MyNavbar from "./presentation/layout/navbar";
import ResponsiveAppBar from "./presentation/layout/navbar/index2";

function App() {
  return (
    <div className="App">
      <Router>
        <div style={{ display: "flex", flexDirection: "column" }}>
          {/* <ResponsiveAppBar /> */}
          <div style={{ flexGrow: 1 }}>
            <Switch>
              <Route path="/about">
                <About />
              </Route>
              <Route path="/blogs">
                <Blog />
              </Route>
              <Route path="/services">
                <Services />
              </Route>
              <Route path="/contact">
                <Contact />
              </Route>
              <Route path="/">
                <Home />
              </Route>
            </Switch>
          </div>
          <Footer />
        </div>
      </Router>

      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header> */}
    </div>
  );
}

export default App;
